  args: {
    id: 'phone-input-default',
    name: 'default'
  },
  render: args => <Fieldset message="Hint message" state="default">
      <PhoneInput id={args.id} onChange={args.onChange} value={args.value} required={args.required} label={args.label} readOnly={args.readOnly} disabled={args.disabled} error={args.error} />
    </Fieldset>,
  play: async ({
    canvasElement,
    step
  }) => {
    const canvas = within(canvasElement);
    const phoneInputField = canvas.getByTestId('zep-phone-input-field');
    const countrySelectButton = canvas.getByTestId('zep-phone-input-country-select-button');
    await step('Initial checks', async () => {
      await expect(phoneInputField).toBeInTheDocument();
      await expect(phoneInputField).not.toHaveFocus();
    });
    await step('Check countrySelect and phoneInputField focus via Keyboard', async () => {
      await expect(phoneInputField).not.toHaveFocus();
      await userEvent.tab();
      await expect(countrySelectButton).toHaveFocus();
      await userEvent.tab();
      await expect(phoneInputField).toHaveFocus();
      await userEvent.tab();
    });
    await step('Check country select via Mouse', async () => {
      await expect(phoneInputField).not.toHaveFocus();
      await userEvent.click(countrySelectButton);
      const countrySelectList = canvas.getByTestId('zep-phone-input-country-select-list');
      await expect(countrySelectList).toHaveFocus();
      await userEvent.click(phoneInputField);
      await expect(phoneInputField).toHaveFocus();
      await userEvent.tab();
    });
    await step('Select countrySelect with keyboard again', async () => {
      await userEvent.tab({
        shift: true
      });
      await expect(phoneInputField).toHaveFocus();
    });
    await step('Fill phoneInputField with keyboard', async () => {
      await userEvent.type(phoneInputField, '123456789');
      await expect(phoneInputField).toHaveDisplayValue('+49 123456789');
    });
    await step('Clear phoneInputField and fill with keyboard again', async () => {
      await userEvent.clear(phoneInputField);
      await userEvent.type(phoneInputField, '987654321');
      await expect(phoneInputField).toHaveDisplayValue('+98 76 5432 1');
    });
    await step('Click phoneInputField and check its focus', async () => {
      await userEvent.click(phoneInputField);
      await expect(phoneInputField).toHaveFocus();
    });
    await step('Blur phoneInputField with keyboard and check focus', async () => {
      await userEvent.tab();
      await expect(phoneInputField).not.toHaveFocus();
    });
  }
